import "./App.css";

function App() {
  return (
    <div className="flex container h-screen">
      <SideBar />
      <Welcome />
    </div>
  );
}
function SideBar() {
  return (
    <div className="h-full bg-purple-400 px-5">
      <h1>SideBar</h1>
    </div>
  );
}
function Welcome() {
  return (
    <div className="py-5 px-2 bg-pink-400 h-2/6 w-screen">
      <h1>Welcome Yashika!</h1>
    </div>
  );
}
function RightBar() {
  return (
    <div>
      <div>
        <h1>Journal</h1>
      </div>
      <div>
        <h1>Music</h1>
      </div>
    </div>
  );
}
export default App;
